const pageLinks=[];
const arrays=[_areyouf,_UJ0CK,a_UJ0CK,_ZTNtyga9to];
arrays.forEach(arr=>{
  arr.forEach(s=>{
    try {
      if(s && s.includes('=s1600')){
        let enc = s.split('=s1600')[0];
        enc = enc.replace(/Vd__xGEvMo_/g,'g').replace(/b/g,'pw_.g28x').replace(/h/g,'d2pr.x_27');
        const decoded=atob(enc);
        const finalLink='https://2.bp.blogspot.com/pw/'+decoded+'=s1600'+s.split('=s1600')[1];
        pageLinks.push(finalLink);
      }
    } catch(e) {}
  });
});
JSON.stringify(pageLinks);
